tables.table_schema:
CREATE TABLE Patients(
  patient_id UUID PRIMARY KEY,
  name TEXT,
  age INTEGER,
  gender TEXT
);

CREATE TABLE RiskFactors(
  factor_id UUID PRIMARY KEY,
  patient_id UUID,
  risk_factor TEXT,
  risk_score INTEGER
);

CREATE TABLE Predictions(
  prediction_id UUID PRIMARY KEY,
  patient_id UUID,
  prediction_date DATE,
  predicted_outcome TEXT
);
